import React from 'react';
import s from './NameDialog.module.css'
import {NavLink} from 'react-router-dom'
const NameDialog = () =>{
    return (
           <div className={s.name_dialogs}>
               <NavLink to='1'> Mike</NavLink>
               <NavLink to='2'> Sasha</NavLink>
               <NavLink to='3'> Dima</NavLink>
               <NavLink to='4' > Tola</NavLink>
               <NavLink to='5'> Ylia</NavLink>

           </div>
    );
}
export default NameDialog;
